import React from 'react';
import { 
  Switch,
  Route,
  // Link,
  HashRouter
} from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavItem from 'react-bootstrap/NavItem';
import Home from './Home.js'
import CreateAccount from './CreateAccount.js'
import NotFound from './NotFound'
import ULogo from './ULogo.js'
// import UButton from './UButton';
import './../style/UNavStyle.css'


export default class UHeader extends React.Component {
  constructor (props) {
    super(props);

    this.state = {
      selections: props.selections
    }
  }

  updateNavBar () {
    this.props.updateNavBar()
  }

  render() {
    return (
      <HashRouter>
        <Navbar className="u-nav sticky-top">
          <NavItem className="ml-4">
            <ULogo height="70px" long />
          </NavItem>
          <Nav className="ml-auto mr-4">
            {/* <Nav.Link as={Link} to="/"><UButton variant="u-white" content="Home" /></Nav.Link>
            <Nav.Link as={Link} to="/create_account"><UButton variant="u-action" content="Sign Up" /></Nav.Link> */}
            {this.state.selections}
          </Nav>
        </Navbar>
        <div className="content">
          <Switch>
            <Route exact path='/' render={(props) => <Home {...props} updateNavBar={() => this.updateNavBar()} />} />
            <Route exact path='/create_account' component={CreateAccount} />
            <Route render={function () {
              return <NotFound />
            }} />
          </Switch>
        </div>
      </HashRouter>
    )
  }
}
